function fireTorpedo(){var e={torpedoPosition:document.getElementById("position").value};fetch("/api/fire",{method:"POST",headers:{Accept:"application/json","Content-Type":"application/json"},body:JSON.stringify(e)}).then(function(e){return e.json()}).then(function(e){dispatch(receiveAuthDetails({access_token:e.access_token,organisationId:e.organisationId,userName:e.userName,refresh_token:e.refresh_token,role:e.role,expires:e[".expires"]}))}).catch(function(e){dispatch(requestAuthFailed("An error occured")),dispatch(logoff())})}function drawBoard(){for(var e='<div id="grid" class="grid">',r="",i=0,o=0;i<10;i++)r+='<div class="grid-cell"></div>';for(;o<10;o++)e+='<div class="grid-row">'+r+"</div>";return e+="</div>"}$("document").ready(function(){var e=document.getElementById("grid-container"),r=drawBoard();e.innerHTML=r});